import React from "react";

const skillsContent = [
  { skillClass: "p70", skillPercent: "70", skillName: "Agile" },
  { skillClass: "p90", skillPercent: "95", skillName: "AWS" },
  { skillClass: "p80", skillPercent: "85", skillName: "C/C++/C#/Java/Python" },
  { skillClass: "p80", skillPercent: "85", skillName: "Cypress/Selenium" },
  { skillClass: "p80", skillPercent: "85", skillName: "Containers/Kubernetes" },
  { skillClass: "p90", skillPercent: "95", skillName: "DevOps" },
  { skillClass: "p80", skillPercent: "85", skillName: "GIT" },
  { skillClass: "p70", skillPercent: "85", skillName: "HTML/CSS/JSS/React.js" },
  { skillClass: "p80", skillPercent: "85", skillName: "Linux/SSH" },
  { skillClass: "p80", skillPercent: "85", skillName: "Networking" },
  { skillClass: "p80", skillPercent: "85", skillName: "SQL/NOSQL" },
  { skillClass: "p80", skillPercent: "85", skillName: "Postman" },
];

const Skills = () => {
  return (
    <>
      {skillsContent.map((val, i) => (
        <div className="col-6 col-md-3 mb-3 mb-sm-5" key={i}>
          <div className={`c100 ${val.skillClass}`}>
            <span>{val.skillPercent}%</span>
            <div className="slice">
              <div className="bar"></div>
              <div className="fill"></div>
            </div>
          </div>
          <h6 className="text-uppercase open-sans-font text-center mt-2 mt-sm-4">
            {val.skillName}
          </h6>
        </div>
      ))}
    </>
  );
};

export default Skills;
